import React from 'react';
import { Link } from 'react-router-dom';
import Header from '../components/layout/Header';
import Footer from '../components/layout/Footer';
import SearchBar from '../components/home/SearchBar';
import CategoryCard from '../components/home/CategoryCard';
import JobCard from '../components/job/JobCard';

const categories = [
  { title: 'Design', jobCount: 235, icon: 'ðŸŽ¨', to: '/jobs?category=design' },
  { title: 'Sales', jobCount: 756, icon: 'ðŸ’¼', to: '/jobs?category=sales' },
  { title: 'Marketing', jobCount: 140, icon: 'ðŸ“ˆ', to: '/jobs?category=marketing' },
  { title: 'Finance', jobCount: 325, icon: 'ðŸ’°', to: '/jobs?category=finance' },
  { title: 'Technology', jobCount: 436, icon: 'ðŸ’»', to: '/jobs?category=technology' },
  { title: 'Engineering', jobCount: 542, icon: 'âš™ï¸', to: '/jobs?category=engineering' },
  { title: 'Business', jobCount: 211, icon: 'ðŸ“Š', to: '/jobs?category=business' },
  { title: 'Human Resource', jobCount: 346, icon: 'ðŸ‘¥', to: '/jobs?category=hr' },
];

const featuredJobs = [
  {
    id: '1',
    title: 'Product Designer',
    company: {
      name: 'Dropbox',
      logo: '/company-logos/dropbox.png',
      location: 'San Francisco, US'
    },
    type: 'Full Time',
    tags: ['Design', 'Remote', 'Senior']
  },
  // Add more featured jobs here
];

const latestJobs = [
  {
    id: '1',
    title: 'Social Media Assistant',
    company: {
      name: 'Netflix',
      logo: '/company-logos/netflix.png',
      location: 'Paris, France'
    },
    type: 'Full Time',
    tags: ['Marketing', 'Social Media']
  },
  // Add more latest jobs here
];

const Home = () => {
  return (
    <div className="min-h-screen bg-gray-50">
      <Header />
      
      {/* Hero Section */}
      <section className="bg-white py-20">
        <div className="container mx-auto px-4">
          <div className="max-w-4xl mx-auto text-center mb-12">
            <h1 className="text-4xl md:text-5xl font-bold mb-6">
              Discover more than
              <span className="text-indigo-600"> 5000+ Jobs</span>
            </h1>
            <p className="text-xl text-gray-600 mb-8">
              Great platform for the job seeker that searching for new career heights and passionate about startups.
            </p>
            <SearchBar />
          </div>

          {/* Popular Tags */}
          <div className="flex flex-wrap justify-center gap-3 mt-8">
            <span className="text-sm text-gray-600">Popular:</span>
            {['UI Designer', 'UX Researcher', 'Android', 'Admin'].map((tag) => (
              <Link
                key={tag}
                to={`/jobs?keyword=${tag}`}
                className="text-sm text-gray-600 hover:text-indigo-600"
              >
                {tag}
              </Link>
            ))}
          </div>
        </div>
      </section>

      {/* Companies Section */}
      <section className="py-12 bg-gray-50">
        <div className="container mx-auto px-4">
          <h2 className="text-2xl font-semibold mb-8 text-center text-gray-600">
            Companies we've helped grow
          </h2>
          <div className="flex justify-center items-center gap-12 flex-wrap">
            {['Vodafone', 'Intel', 'Tesla', 'AMD', 'Talkia'].map((company) => (
              <span key={company} className="text-gray-400 text-xl font-semibold">
                {company}
              </span>
            ))}
          </div>
        </div>
      </section>

      {/* Categories Section */}
      <section className="py-16 bg-white">
        <div className="container mx-auto px-4">
          <div className="flex justify-between items-center mb-8">
            <h2 className="text-2xl font-bold">
              Explore by <span className="text-indigo-600">category</span>
            </h2>
            <Link to="/categories" className="text-indigo-600 hover:text-indigo-700">
              Show all jobs â†’
            </Link>
          </div>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
            {categories.map((category) => (
              <CategoryCard
                key={category.title}
                icon={category.icon}
                title={category.title}
                jobCount={category.jobCount}
                to={category.to}
              />
            ))}
          </div>
        </div>
      </section>

      {/* Featured Jobs Section */}
      <section className="py-16 bg-gray-50">
        <div className="container mx-auto px-4">
          <div className="flex justify-between items-center mb-8">
            <h2 className="text-2xl font-bold">
              Featured <span className="text-indigo-600">jobs</span>
            </h2>
            <Link to="/jobs" className="text-indigo-600 hover:text-indigo-700">
              Show all jobs â†’
            </Link>
          </div>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
            {featuredJobs.map((job) => (
              <JobCard key={job.id} {...job} isFeatured />
            ))}
          </div>
        </div>
      </section>

      {/* Latest Jobs Section */}
      <section className="py-16 bg-white">
        <div className="container mx-auto px-4">
          <div className="flex justify-between items-center mb-8">
            <h2 className="text-2xl font-bold">
              Latest <span className="text-indigo-600">jobs open</span>
            </h2>
            <Link to="/jobs" className="text-indigo-600 hover:text-indigo-700">
              Show all jobs â†’
            </Link>
          </div>
          <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
            {latestJobs.map((job) => (
              <JobCard key={job.id} {...job} />
            ))}
          </div>
        </div>
      </section>

      <Footer />
    </div>
  );
};

export default Home;
